import logo from './logo.svg';
import './App.css';
import Items from './Products/Products';
import { Button } from '@mui/material';

function App() {
  return (
    <>
      <div>
        <header className='title'>This is an ecomm site</header>
        <Button className='login-button' variant="contained">Contained</Button>
      </div>

      <Items className='products-body'/>
    </>
  );
}

export default App;
